"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?1/55/1912/contributors\">",
"     Aaron E Bair, MD, MSc, FAAEM, FACEP",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?1/55/1912/contributors\">",
"     Section Editor",
