"     <a class=\"medical medical_review\" href=\"UTD.htm?6/25/6554?source=related_link\">",
"      Mechanical ventilation of adults in the emergency department",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?30/35/31288?source=related_link\">",
"      Neuromuscular blocking agents (NMBA) for rapid sequence intubation in adults",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?37/55/38775?source=related_link\">",
"      Pretreatment agents for rapid sequence intubation in adults",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?23/29/24026?source=related_link\">",
"      Rapid sequence intubation (RSI) in children",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?11/30/11754?source=related_link\">",
"      Sedation or induction agents for rapid sequence intubation in adults",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?22/12/22726?source=related_link\">",
"      The decision to intubate",
"     </a>",
