var title_f1_55_1916="High low sodium foods PI";
var content_f1_55_1916=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PI%2F74448&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PI%2F74448&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Ways to cut down on salt (sodium)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"2\" width=\"50%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Avoid these foods",
"       </td>",
"       <td class=\"subtitle1\">",
"        Try these foods instead",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Cured and smoked foods such as bacon, sausage, hot dogs, ham, lunch meats, and corn beef",
"       </td>",
"       <td>",
"        Fresh turkey, chicken, and lean beef",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Canned fish (such as sardines)",
"       </td>",
"       <td>",
"        Unsalted tuna",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Canned meats",
"       </td>",
"       <td>",
"        Tofu",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Salted pretzels, crackers, potato chips, and nuts",
"       </td>",
"       <td>",
"        Low sodium and unsalted versions of these foods",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Most cheeses",
"       </td>",
"       <td>",
"        Low sodium cheeses",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Sauces (tomato and cream etc), tomato juices",
"       </td>",
"       <td>",
"        Low sodium versions of these foods, such as low sodium tomato juice",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"4\">",
"        Processed, instant, and convenience foods such as frozen dinners, packaged meals, canned soups, and boxed pasta blends",
"       </td>",
"       <td class=\"sublist1_start\">",
"        Cook and freeze your own low sodium meals, soups, and broths",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        <ul>",
"         <li>",
"          If you must use convenience or processed foods, read the labels and choose items with 140-200 mg of sodium per serving per food, or",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        <ul>",
"         <li>",
"          For an entire convenience meal (frozen dinner) try to stay under 500-600 mg sodium.",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        <ul>",
"         <li>",
"          If you do used canned foods, use \"sodium free\" varieties, or rinse the canned food under water. This reduces the sodium content by about 40 percent.",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
