var title_f1_55_1917="Monitor during amiodarone";
var content_f1_55_1917=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F50410&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F50410&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Amiodarone monitoring and recommendations",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"3\" width=\"15%\">",
"     </colgroup>",
"     <colgroup span=\"2\" width=\"27%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" rowspan=\"2\">",
"        System",
"       </td>",
"       <td class=\"subtitle1\" colspan=\"2\">",
"        Monitoring",
"       </td>",
"       <td class=\"subtitle1\" rowspan=\"2\">",
"        Possible adverse effect",
"       </td>",
"       <td class=\"subtitle1\" rowspan=\"2\">",
"        Recommendation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        Baseline",
"       </td>",
"       <td class=\"subtitle2\">",
"        Follow-up",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Cardiac",
"       </td>",
"       <td rowspan=\"2\">",
"        ECG (at baseline and during loading dose)",
"       </td>",
"       <td rowspan=\"2\">",
"        Yearly",
"       </td>",
"       <td>",
"        QT prolongation; torsade de pointes",
"       </td>",
"       <td rowspan=\"2\">",
"        Reduce amiodarone dose or discontinue use",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Symptomatic sinoatrial or conduction system impairment",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        Dermatologic",
"       </td>",
"       <td rowspan=\"2\">",
"        Physical examination",
"       </td>",
"       <td rowspan=\"2\">",
"        As needed for signs/symptoms",
"       </td>",
"       <td>",
"        Photosensitivity to UV light",
"       </td>",
"       <td>",
"        Avoid sunlight; use sunscreen",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Blue-gray skin discoloration",
"       </td>",
"       <td>",
"        Reduce amiodarone dose or discontinue use",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        Endocrine",
"       </td>",
"       <td rowspan=\"2\">",
"        Thyroid function tests",
"       </td>",
"       <td rowspan=\"2\">",
"        Every 6 months",
"       </td>",
"       <td>",
"        Hyperthyroidism",
"       </td>",
"       <td>",
"        Discontinue amiodarone; refer to endocrinologist",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hypothyroidism",
"       </td>",
"       <td>",
"        Treat with levothyroxine",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Hepatic",
"       </td>",
"       <td>",
"        AST or ALT",
"       </td>",
"       <td>",
"        Every 6 months",
"       </td>",
"       <td>",
"        AST or ALT elevation &ge;2x upper limit of reference range",
"       </td>",
"       <td>",
"        Reduce amiodarone dose or discontinue use",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Neurologic",
"       </td>",
"       <td>",
"        Physical examination",
"       </td>",
"       <td>",
"        As needed for signs/symptoms",
"       </td>",
"       <td>",
"        Ataxia, dizziness, fatigue",
"       </td>",
"       <td>",
"        Reduce amiodarone dose or discontinue use",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        Ophthalmologic",
"       </td>",
"       <td rowspan=\"2\">",
"        Eye examination",
"       </td>",
"       <td rowspan=\"2\">",
"        As needed for signs/symptoms",
"       </td>",
"       <td>",
"        Corneal microdeposits",
"       </td>",
"       <td>",
"        Continue amiodarone treatment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Optic neuropathy",
"       </td>",
"       <td>",
"        Discontinue treatment",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        Pulmonary",
"       </td>",
"       <td>",
"        Pulmonary function tests",
"       </td>",
"       <td>",
"        As needed for signs/symptoms",
"       </td>",
"       <td rowspan=\"2\">",
"        Pulmonary toxicity (cough, fever, dyspnea)",
"       </td>",
"       <td rowspan=\"2\">",
"        Discontinue amiodarone immediately; consider corticosteroid treatment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Chest radiograph",
"       </td>",
"       <td>",
"        Yearly",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     ALT: alanine aminotransferase; AST: aspartate aminotransferase; ECG: electrocardiogram.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Vassallo P, Trohman RG. Prescribing amiodarone: an evidence-based review of clinical indications. JAMA 2007; 298:1312. Copyright &copy; American Medical Association. All rights reserved.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
